reactDOM.render(<div>
  <h1>Here is a list created by using react DOM</h1>
  <ul>
    <li>First Item</li>
    <li>Second Item</li>
    <li>Third Item</li>
  </ul>
  {/* <h2>Today it's : {currentDate}</h2> */}
